namespace BusinessLogic.Tests.Images
{
    using System.IO;
    using System.Text;

    using BusinessLogic.Images;
    
    using Xunit;

    public class ImageTests
    {
        public class RemoveFromJpg
        {
            [Fact]
            public void PassJpgWithMetadata_RemoveFromJpg_ReturnsImageWithoutMetadata()
            {
                var image =
                    "";
                var inStream = new MemoryStream(Encoding.ASCII.GetBytes(image));
                var cleanedImage = new JpgImageManipulation().RemoveExifData(inStream);
                Assert.NotNull(cleanedImage);
                Assert.Equal(
                    ""
                    , cleanedImage);
            }
        }

        public class AttemptConversionToJpg
        {
            [Fact]
            public void WithEmptyByteArrayLength10_AttemptConversionToJpg_ReturnMatchingSourceAndConvertedFile()
            {
                var imageData = new JpgImageConversion().AttemptConversion(new byte[10]);
                Assert.NotNull(imageData);
                Assert.Equal(imageData.ConvertedFile, imageData.SourceFile);
            }
        }
    }
}
